import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'
const style={};
let curDate= new Date(2021,5,5,7);
curDate=curDate.getHours();
let greeting='';
if(curDate>=1 && curDate<12)
{
    greeting='Good Morning';
    style.color='Green';
}else if(curDate>=12 && curDate<7)
{
  greeting='Good Afternoon';
  style.color='Red';
}
else{
    greeting='Good Night';
    style.color='Black';
}
ReactDOM.render(
    <h1>Hello Sir,<span style= 'style'>{greeting}</span> Time: {curDate}</h1>,document.getElementById('root')
);
